import Layout from "../components/Layout";
import styles from '../styles/index.module.css';

// components/Tile.js

const Home = () => (
    <Layout>

        <main>
            <div className={styles.mainContainer}>
                <div className={styles.leftSide}>
                    <h1>its jason!</h1>

                </div>
            </div>
        </main>

    </Layout>
);

export default Home;
